import React, { Component } from "react";
//import styled from "style-components";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";

class NavigationBar extends Component {
  constructor() {
    super();
    this.state = {
      search: "Enter Symbol for Details"
    };
  }

  updateSearch(event) {
    this.setState({ search: event.target.value.substr(0, 5) });
  }

  render() {
    // let filteredContacts = this.props.contacts.filter(
    //   (contact) => {
    //     return contact.name.indexOf(this.state.search) !== -1;
    //   }
    // );
    return (
      // <React.Fragment>
      //   <ul>
      //     {filteredContacts.map(assets => {
      //       return <Contact contact={contact} key={contact.id} />;
      //     })}
      //   </ul>
      <div>
        <h1>{this.state.search}</h1>

        <Navbar bg="light" variant="light" sticky="top">
          <Navbar.Brand href="#home">HDAI</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="">Last update time - {this.props.time} </Nav.Link>
          </Nav>
          <Form inline>
            <FormControl
              type="text"
              placeholder="Search Asset Details"
              className="mr-sm-2"
              value={this.state.search}
              onChange={this.updateSearch.bind(this)}
            />
            <Button variant="outline-primary">Search</Button>
          </Form>
        </Navbar>
      </div>
      //</React.Fragment>
    );
  }
}

export default NavigationBar;
